import React, { useState } from "react";
import "./App.css";
import Photo from "../src/Component/Photo";
import Navbar from "../src/Component/Navbar";
import Aboutme from "../src/Component/Aboutme";
import Socialnet from "../src/Component/Socialnet";
import Footer from "../src/Component/Footer";
import Contact from "../src/Component/Contact";

import stateContext from "./context/stateContext";


function App() {

  const [ componentName, setComponentName ] = useState();

  console.log(componentName);



  const [ view, setView ] = useState({
    about: true,
    contact: false,
    stackt: false,
    pricing: false,
  });

  return (
    <stateContext.Provider
      value={{view, setView
      }}
    >
      <>
        <div className="container1 bg-dark">
          <Navbar 
            setComponentName = {setComponentName}
          />
          <div className="net">
            <Socialnet />
          </div>
        </div>

        <div className="container2 bg-dark">

          { componentName  === "about" && <Aboutme />}

        </div>

        <Footer />
      </>
    </stateContext.Provider>
  );
}

export default App;
